nys_school_forms.autocomplete.teacher:
  path: '/admin/nys_school_forms/autocomplete/teacher'
  defaults:
    _controller: '\Drupal\nys_school_forms\Controller\TeacherAutocompleteController::handleAutocomplete'
    _format: json
  requirements:
    _permission: 'access content'
nys_school_forms.autocomplete.school:
  path: '/admin/nys_school_forms/autocomplete/school'
  defaults:
    _controller: '\Drupal\nys_school_forms\Controller\SchoolAutocompleteController::handleAutocomplete'
    _format: json
  requirements:
    _permission: 'access content'
nys_school_forms.school_forms:
  path: '/admin/school-forms2'
  defaults:
    _title: 'School Form Search'
    _controller: '\Drupal\nys_school_forms\Controller\SchoolFormsController::view'
  requirements:
    _permission: 'access content'
  options:
    no_cache: 'TRUE'
